export interface PatientHeaderInfo {
    nombre: string;
    apellido: string;
    documento: string;
    edad: string;
    sexo: string;
    foto?: string;
}

export interface MutualistaContactInfo {
    mutualista: string;
    domicilio: string;
    departamento: string;
    localidad: string;
    telefonoPrimario: string;
    telefonoAlternativo: string;
    email: string;
    contactoRef: {
        nombre: string;
        telefono: string;
        domicilio: string;
        departamento: string;
        localidad: string;
    };
}

export interface PatientNote {
    id: number;
    fecha: string;
    nota: string;
}

export type AntecedenteType = 'Personal' | 'Familiar' | 'Socioeconomico';

export interface Antecedente {
    id: number;
    descripcion: string;
    tipo: AntecedenteType;
    fechaRegistro: string;
    observaciones?: string;
    parentesco?: string; // Only for 'Familiar'
}

export interface PatientAlert {
    id: number;
    descripcion: string;
    observaciones?: string;
    fechaInicio: string;
    fechaFin?: string;
    registradoPor: {
        nombre: string;
        apellido: string;
        cjppu: string;
        fechaRegistro: string;
    };
}

export interface PatientContactInfoResponse extends MutualistaContactInfo {
    fechaNacimiento: string;
}

